GUI = {
  finished = false,
  demands = 0,
  fd_option = 0,
  boss_demand_ids = {},
  boss_demand_effects = {},
  boss_demand_effect_vars = {},
  boss_reveal_effect_vars = {},
  allow_buttons = true,
  bd_timer = 0,
  event_owner_panel_nodes = {},
  event_owner_nodes = {}
}
function Init()
  UISystem.PlaySound(UIEnums.SoundEffect.GarageEnter)
  AddSCUI_Elements()
  UIScreen.SetScreenTimers(0.3, 0.6)
  Amax.SetCurrentSpTier(UIGlobals.Sp.CurrentTier)
  net_SetRichPresence(UIEnums.RichPresence.SpChoosing)
  Amax.RequestRivalRemotePicture()
  StoreInfoLine()
  SetupInfoLine()
  GUI.MenuId = SCUI.name_to_id.Event_menu
  GUI.boss_unlocked = UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].unlocked
  GUI.boss_defeated = UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].defeated
  UIGlobals.Sp.CurrentTierBossUnlocked = GUI.boss_unlocked
end
function PostInit()
  UIButtons.TimeLineActive("Hide_TierSelect", true)
  GUI.list = {}
  for _FORV_3_, _FORV_4_ in ipairs(UIGlobals.Sp.TierInfo[UIGlobals.Sp.CurrentTier].events) do
    GUI.event_owner_panel_nodes[_FORV_3_] = UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node")
    UIButtons.SetActive(UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "New"), SinglePlayer.EventInfo(_FORV_4_).new)
    if SinglePlayer.EventInfo(_FORV_4_).unlocked == false then
      UIButtons.SwapColour(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "Main_Black", "!255 32 32 32")
      UIButtons.SwapColour(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "Main_White", "!255 64 64 64")
      UIButtons.SwapColour(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "Main_2", "!255 64 64 64")
      UIButtons.SetActive(UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "LockedIcon"), true)
    end
    if Sp_CompletedEventOnHard(SinglePlayer.EventInfo(_FORV_4_).difficulty) == true then
      UIButtons.SetActive(UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "ItsHard"), true)
    end
    if FriendDemand.NumFriendDemandsForEvent(SinglePlayer.EventInfo(_FORV_4_).eventId).total > 0 then
      UIButtons.SetActive(UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "FriendDemandIcon"), true)
      if SinglePlayer.EventInfo(_FORV_4_).unlocked == false then
        UIButtons.SwapColour(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "Support_2", "!255 64 64 64")
      end
    end
    SpEventSelect_UpdatePanel(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), SinglePlayer.EventInfo(_FORV_4_), GameData.GetEvent(SinglePlayer.EventInfo(_FORV_4_).eventId), _FORV_3_)
    for _FORV_14_ = 1, SP_MaxStars(SinglePlayer.EventInfo(_FORV_4_).kind == "boss") do
      UIButtons.SetParent(Sp_CreateStar(_FORV_14_ <= Sp_EventStateToStars(SinglePlayer.EventInfo(_FORV_4_).state, SinglePlayer.EventInfo(_FORV_4_).kind == "boss"), _FORV_14_, SinglePlayer.EventInfo(_FORV_4_).state), UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "Light_Root"), UIEnums.Justify.TopRight)
    end
    if SinglePlayer.EventInfo(_FORV_4_).kind == "boss" == false then
      UIButtons.SetParent(Sp_CreateStar(SinglePlayer.EventInfo(_FORV_4_).fanParComplete, 6.5, nil, true), UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "Light_Root"), UIEnums.Justify.TopRight)
      UIButtons.SetParent(Sp_CreateStar(SinglePlayer.EventInfo(_FORV_4_).fanRunComplete, 7.5, nil, nil, true), UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), "Light_Root"), UIEnums.Justify.TopRight)
    end
    UIButtons.AddListItem(GUI.MenuId, UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node"), _FORV_3_)
    if SinglePlayer.EventInfo(_FORV_4_).unlocked == false then
      UIButtons.LockNode((UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node")))
    end
    GUI.list[_FORV_3_] = {
      event = SinglePlayer.EventInfo(_FORV_4_),
      amax_event = GameData.GetEvent(SinglePlayer.EventInfo(_FORV_4_).eventId),
      node_id = UIButtons.CloneXtGadgetByName("SpSCUI", "Event_Node")
    }
  end
  if UIGlobals.SpBossDemandStore == nil then
    UIGlobals.SpBossDemandStore = {}
  end
  if UIGlobals.SpBossDemandStore[UIGlobals.Sp.CurrentTier] == nil then
    UIGlobals.SpBossDemandStore[UIGlobals.Sp.CurrentTier] = {}
    CloneTable(UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier], UIGlobals.SpBossDemandStore[UIGlobals.Sp.CurrentTier])
  end
  for _FORV_8_, _FORV_9_ in ipairs(UIGlobals.SpBossDemandStore[UIGlobals.Sp.CurrentTier].demands) do
    GUI.boss_demand_ids[_FORV_8_] = {}
    UIButtons.ChangeText(UIButtons.CloneXtGadgetByName("SpSCUI", "BossDemands_Title"), ("SPL_TIER_" .. UIGlobals.Sp.CurrentTier - 1 .. "BD" .. _FORV_8_ - 1) .. "_TITLE")
    GUI.boss_demand_ids[_FORV_8_].amount = UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "BossDemands_Title"), "Amount")
    UIButtons.ChangeText(GUI.boss_demand_ids[_FORV_8_].amount, "GAME_PROGRESS_" .. math.floor(_FORV_9_.value) .. "_" .. math.floor(_FORV_9_.target))
    GUI.boss_demand_ids[_FORV_8_].tick = UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "BossDemands_Title"), "Tick")
    UIButtons.SetActive(GUI.boss_demand_ids[_FORV_8_].tick, _FORV_9_.complete)
    UIButtons.SetParent(UIButtons.CloneXtGadgetByName("SpSCUI", "BossDemands_Title"), SCUI.name_to_id.BossDemands_Root, UIEnums.Justify.BottomLeft)
    GUI.boss_demand_ids[_FORV_8_].fill = UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "BossDemands_Title"), "Fill")
    GUI.boss_demand_ids[_FORV_8_].fill_progress = UIButtons.FindChildByName(UIButtons.CloneXtGadgetByName("SpSCUI", "BossDemands_Title"), "Fill_Progress")
    UIButtons.ChangeSize(GUI.boss_demand_ids[_FORV_8_].fill_progress, UIButtons.GetSize(GUI.boss_demand_ids[_FORV_8_].fill) * _FORV_9_.progress, UIButtons.GetSize(GUI.boss_demand_ids[_FORV_8_].fill))
    if _FORV_9_.progress ~= UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].demands[_FORV_8_].progress then
      GUI.boss_demand_effects[#GUI.boss_demand_effects + 1] = _FORV_8_
    end
  end
  if 0 < #GUI.boss_demand_effects then
    GUI.boss_demand_effect_vars.active = true
    GUI.boss_demand_effect_vars.timer = 0
    GUI.boss_demand_effect_vars.current = 1
    if 0 + 1 >= #UIGlobals.SpBossDemandStore[UIGlobals.Sp.CurrentTier].demands then
      GUI.allow_buttons = false
      UIButtons.SetSelected(GUI.MenuId, false)
      GUI.do_boss_reveal = true
    end
  end
  if GUI.boss_unlocked ~= true then
    UIButtons.SetParent(UIButtons.CloneXtGadgetByName("SpSCUI", "event_Boss" .. UIGlobals.Sp.CurrentTier), SCUI.name_to_id.Boss_Node, UIEnums.Justify.None)
  end
  if IsNumber(UIGlobals.Sp.CurrentEvent) == true then
    UIButtons.SetSelection(GUI.MenuId, UIGlobals.Sp.CurrentEvent)
  else
    UIGlobals.Sp.CurrentEvent = UIButtons.GetSelection(GUI.MenuId)
  end
  GUI.currentEvent = -1
  SpEventSelect_UpdateInfoLine(true)
  if Sp_ReturnFromGame() == true then
    if UIGlobals.SpReturnMode ~= UIGlobals.SpSelectMode_Event then
      print("Error return mode", UIGlobals.SpReturnMode, " not currently supported")
    end
    UIButtons.SetSelection(GUI.MenuId, UIGlobals.Sp.CurrentEvent)
    UIGlobals.SpSelectMode = UIGlobals.SpSelectMode_Event
    UIGlobals.SpReturnMode = nil
  end
  AIGamerPicture(SCUI.name_to_id.Demands_Avatar, UIGlobals.boss_avatar_ids[UIGlobals.Sp.CurrentTier])
  UIButtons.ChangeText(SCUI.name_to_id.Demands_Title, "SPL_TIER_" .. UIGlobals.Sp.CurrentTier - 1 .. "DEMANDS")
  AIGamerPicture(SCUI.name_to_id.Bio_Avatar, UIGlobals.boss_avatar_ids[UIGlobals.Sp.CurrentTier])
  UIButtons.ChangeText(SCUI.name_to_id.Bio_Title, "SPL_TIER_" .. UIGlobals.Sp.CurrentTier - 1 .. "DEMANDS_COMPLETE")
  UIButtons.ChangeText(SCUI.name_to_id.Bio_Text1, UIText["SP_BOSS_" .. UIGlobals.Sp.CurrentTier .. "_BIO"])
  UIButtons.ChangeSize(SCUI.name_to_id.BioFrame, UIButtons.GetSize(SCUI.name_to_id.BioFrame))
  UIButtons.ChangeSize(SCUI.name_to_id.BioInner, UIButtons.GetSize(SCUI.name_to_id.BioFrame))
  if GUI.boss_unlocked == true then
    if GUI.boss_defeated == true then
      if UIGlobals.Sp.CurrentTier == #UIGlobals.Sp.TierInfo then
        print("She's a special case : Evil Shannon")
        UIButtons.ChangeText(SCUI.name_to_id.Defeated_Title, UIText.VEH_FULL_ASTRA_SHANNON)
        UIButtons.ChangeText(SCUI.name_to_id.Defeated_Text0, UIText.MP_MODSHOP_NAME_BOSS_SUPERMOD)
        UIButtons.ChangeText(SCUI.name_to_id.Defeated_Text1, UIText.MP_MODSHOP_DESC_BOSS_SUPERMOD)
        UIShape.ChangeObjectName(SCUI.name_to_id.Defeated_ModIcon, "shannonbossmod")
        UIButtons.SetActive(SCUI.name_to_id.Defeated_ModIcon, false)
        UIButtons.SetActive(SCUI.name_to_id.Defeated_Text0, false)
        UIButtons.SetParent(SCUI.name_to_id.Defeated_Text1, SCUI.name_to_id.DefeatedFrame, UIEnums.Justify.TopCentre)
        UIButtons.ChangePosition(SCUI.name_to_id.Defeated_Text1, nil, -0.75, nil, true)
      elseif Multiplayer.GetAbility(UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].vehicle_ability, true) ~= nil then
        UIButtons.ChangeText(SCUI.name_to_id.Defeated_Text0, Multiplayer.GetAbility(UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].vehicle_ability, true).name)
        UIButtons.ChangeText(SCUI.name_to_id.Defeated_Text1, Multiplayer.GetAbility(UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].vehicle_ability, true).desc)
        UIShape.ChangeObjectName(SCUI.name_to_id.Defeated_ModIcon, Multiplayer.GetAbility(UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].vehicle_ability, true).icon_name)
        if IsTable((GameData.GetVehicle(UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].vehicle_id))) == true then
          UIButtons.ChangeText(SCUI.name_to_id.Defeated_Title, GameData.GetVehicle(UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].vehicle_id).name_full)
        end
      end
      UIButtons.ChangeSize(SCUI.name_to_id.DefeatedFrame, UIButtons.GetSize(SCUI.name_to_id.DefeatedFrame))
      UIButtons.ChangeSize(SCUI.name_to_id.DefeatedInner, UIButtons.GetSize(SCUI.name_to_id.DefeatedFrame))
    else
      UIButtons.SetActive(SCUI.name_to_id.Bio_Tick, true)
    end
    GUI.hide_boss_demands = true
  else
    UIButtons.TimeLineActive("Hide_Bio", true)
    UIButtons.TimeLineActive("Hide_Defeated", true)
    GUI.hide_boss_demands = false
  end
  GUI.show_boss_car = GUI.boss_unlocked
  if GUI.do_boss_reveal == true then
    GUI.show_boss_car = false
  end
  if GUI.show_boss_car == true then
    UIButtons.TimeLineActive("Hide_Demands", true)
    Amax.ChangeLocationNodeActor(SCUI.name_to_id.WorldPos, "Sp_2b")
    UIButtons.TimeLineActive("Hide_BossDemands", true, 1)
    UIButtons.SetActive(SCUI.name_to_id.Gfx_Vignette, true)
    Amax.LoadCar(UIGlobals.Sp.BossInfo[UIGlobals.Sp.CurrentTier].vehicle_id, false)
  else
  end
  DeferCam_Init("Sp_2", nil, 0.3)
  if GUI.show_boss_car == false then
    UIButtons.SetActive(SCUI.name_to_id.Demands_Node, true)
  elseif GUI.boss_unlocked == true then
    if GUI.boss_defeated == true then
      UIButtons.SetActive(SCUI.name_to_id.Defeated_Node, true)
    else
      UIButtons.SetActive(SCUI.name_to_id.Bio_Node, true)
    end
  end
  SpEventSelect_UpdateInfoLine(true)
end
